import React from 'react';
import './App.css';
import { Navbar } from 'rsuite';

function App() {
  return (
    <div className="App">
    <Navbar enum='inverse'>
    <Navbar.Header>
    <Navbar.Body>
    Abc
    </Navbar.Body>
    </Navbar.Header>
    </Navbar>

    </div>
  );
}

export default App;
